script: |
  super -f text -I q11325.spq | sort > q11325.out

inputs:
  - name: q11325.spq
    data: |
      SELECT * FROM tab1 (FORMAT parquet) WHERE + col1 NOT BETWEEN col2 * + + CAST ( NULL AS REAL ) AND col0 / 64;
  - name: tab1

outputs:
  - name: q11325.out
    data: |
      51	14	96
      85	5	59
      91	47	68
